import React, { Component } from 'react';

export default class Home extends Component {
    render () {
        return (
            <div className="home-content">
                <div className="welcome">Hello every one</div>
                <div className="introduce">
                    I am Hai, I am from VietNam
                </div>
            </div>
        )
    }
}
